description:
Cop vs Killer telefilm Misdaad/Thriller 2012 NL gesproken


[img]http://img210.imageshack.us/img210/9789/copvskiller.jpg[/img]



Nederland
Misdaad / Thriller
87 minuten


geregisseerd door Simon de Waal
met Jeroen Willems, Marcel Hensema en Rogier Philipoom


Rechercheur Frank Spinola probeert al tijdenlang samen met zijn speciale team de meedogenloze topcrimineel Mirko Narain te pakken te krijgen. Maar wat hij ook probeert, Mirko is hem telkens een stapje voor. Het lijkt wel alsof hij een informant heeft. Frank houdt zich strikt aan de regels. Totdat hij door Mirko op een onheilspellende manier wordt geprovoceerd en de veiligheid van zijn eigen gezin in het geding komt. De strijd escaleert wanneer Frank ontdekt dat ook Mirko een zwakke plek heeft, een dochter.




